import logo from './logo.svg';
import './App.css';
import Menu from './Menu';
import { DAppProvider, ChainId } from "@usedapp/core"

function App() {
  config = { supportedChains: [ChainId.Kovan, ChainId.Rinkeby] }
  return (
    <DAppProvider config={config}>
      <div className="App">
        <header className="App-header">
          <Menu />
        </header>
      </div>
    </DAppProvider>
  );
}

export default App;
